// About.js

import React from 'react';
import './About.css';
const About = () => {
  return (
    <div className="about">
      <h1>About Us</h1>
      <p>Welcome to our hospital management system. We are dedicated to providing excellent healthcare services to our patients.</p>
      <p>Our team of experienced doctors and staff work tirelessly to ensure the well-being of our patients.</p>
    </div>
  );
}

export default About;
